import React, { Component } from 'react';
import './Movie.css';

class Movie extends Component{
	render(){
		console.log(this.props)
		return(
			<div>
				<MoviePoster poster={this.props.poster}/>
				<h1>{this.props.title}</h1>
			</div>
		);
	}
}

class MoviePoster extends Component{
	render(){
		return(
			<img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2Ff%2Ff3%2FVisual_Studio_Code_0.10.1_icon.png&imgrefurl=https%3A%2F%2Fko.wikipedia.org%2Fwiki%2F%25ED%258C%258C%25EC%259D%25BC%3AVisual_Studio_Code_0.10.1_icon.png&docid=LMOoBDG4L3CbDM&tbnid=U-yu5FwC1r52tM%3A&vet=10ahUKEwjdxuPbrPXhAhWHyIsBHb9VDv0QMwg-KAAwAA..i&w=256&h=256&itg=1&bih=841&biw=1491&q=%EB%B9%84%EC%A3%BC%EC%96%BC%20%EC%8A%A4%ED%8A%9C%EB%94%94%EC%98%A4%20%EC%BD%94%EB%93%9C&ved=0ahUKEwjdxuPbrPXhAhWHyIsBHb9VDv0QMwg-KAAwAA&iact=mrc&uact=8"/>
		);
	}
}

export default Movie
